import { StyleSheet } from "react-native";

const Styles = StyleSheet.create({
    text: {
        backgroundColor: "#f7fafc",
        marginLeft: 10,
        height: 50,
        marginTop: 10,
        marginBottom: 10,
        width: '100%',
        borderBottomColor: "#A9B4B4",
        borderBottomWidth: 1,
        color: "rgb(94 83 83)",
        outlineStyle: "none",
    },
    button: {
        backgroundColor: "#0065ff",
        borderRadius: 10,
        height: 50,
        justifyContent: "center",
        alignItems: "center",
        width: '100%',
        color: "#FFFFFF", 
        fontFamily: "Arial",
    },
    buttonText: {
        color: "#FFFFFF",
    }
});

export default Styles;
